import React from 'react';
import './FinanceTip.css'; // –ø–æ–¥–∫–ª—é—á–∞–µ–º —Å—Ç–∏–ª–∏

const FinanceTip = () => {
    const tips = [
        "–°–ª–µ–¥–∏—Ç–µ –∑–∞ –∫—É—Ä—Å–æ–º –ø–µ—Ä–µ–¥ –æ–±–º–µ–Ω–æ–º –≤–∞–ª—é—Ç—ã.",
        "–û—Ç–∫—Ä—ã—Ç–∏–µ –≤–∫–ª–∞–¥–∞ –æ–Ω–ª–∞–π–Ω –º–æ–∂–µ—Ç –¥–∞—Ç—å –¥–æ–ø–æ–ª–Ω–∏—Ç–µ–ª—å–Ω—ã–π –ø—Ä–æ—Ü–µ–Ω—Ç.",
        "–ù–µ –æ–±–º–µ–Ω–∏–≤–∞–π—Ç–µ –≤–∞–ª—é—Ç—É –≤ –≤—ã—Ö–æ–¥–Ω—ã–µ ‚Äî –∫—É—Ä—Å —á–∞—Å—Ç–æ –Ω–µ–≤—ã–≥–æ–¥–µ–Ω.",
        "–ò—Å–ø–æ–ª—å–∑—É–π—Ç–µ –º–æ–±–∏–ª—å–Ω–æ–µ –ø—Ä–∏–ª–æ–∂–µ–Ω–∏–µ –¥–ª—è –±—ã—Å—Ç—Ä–æ–≥–æ –¥–æ—Å—Ç—É–ø–∞ –∫ –≤–∫–ª–∞–¥–∞–º.",

        "–ü–µ—Ä–µ–¥ –ø–µ—Ä–µ–≤–æ–¥–æ–º –∑–∞ –≥—Ä–∞–Ω–∏—Ü—É —Å—Ä–∞–≤–Ω–∏—Ç–µ –∫–æ–º–∏—Å—Å–∏–∏ —Ä–∞–∑–Ω—ã—Ö –±–∞–Ω–∫–æ–≤.",
        "–î–µ–ª–∞–π—Ç–µ —Ä–µ–≥—É–ª—è—Ä–Ω—ã–µ –≤–∑–Ω–æ—Å—ã –Ω–∞ –Ω–∞–∫–æ–ø–∏—Ç–µ–ª—å–Ω—ã–π —Å—á—ë—Ç ‚Äî —ç—Ç–æ —Ñ–æ—Ä–º–∏—Ä—É–µ—Ç –ø—Ä–∏–≤—ã—á–∫—É.",
        "–ê–∫—Ç–∏–≤–∏—Ä—É–π—Ç–µ SMS-—É–≤–µ–¥–æ–º–ª–µ–Ω–∏—è –¥–ª—è –∫–æ–Ω—Ç—Ä–æ–ª—è —Ä–∞—Å—Ö–æ–¥–æ–≤.",
        "–ò–Ω–æ–≥–¥–∞ –≤—ã–≥–æ–¥–Ω–µ–µ –æ–±–º–µ–Ω–∏–≤–∞—Ç—å –∫—Ä—É–ø–Ω—É—é —Å—É–º–º—É —Å—Ä–∞–∑—É, —á–µ–º –º–µ–ª–∫–∏–µ —á–∞—Å—Ç–∏.",
        "–ü—Ä–æ–≤–µ—Ä—è–π—Ç–µ —É—Å–ª–æ–≤–∏—è –ø–æ –≤–∫–ª–∞–¥–∞–º ‚Äî –≤–æ–∑–º–æ–∂–Ω—ã —Å–∫—Ä—ã—Ç—ã–µ –∫–æ–º–∏—Å—Å–∏–∏ –ø—Ä–∏ –¥–æ—Å—Ä–æ—á–Ω–æ–º —Å–Ω—è—Ç–∏–∏.",
        "–•—Ä–∞–Ω–∏—Ç–µ —á–∞—Å—Ç—å —Å–±–µ—Ä–µ–∂–µ–Ω–∏–π –≤ –≤–∞–ª—é—Ç–µ ‚Äî —ç—Ç–æ –∑–∞—â–∏—Ç–∞ –æ—Ç –∏–Ω—Ñ–ª—è—Ü–∏–∏.",
        "–ü–µ—Ä–µ–¥ –æ—Ñ–æ—Ä–º–ª–µ–Ω–∏–µ–º –∫—Ä–µ–¥–∏—Ç–∞ —É–∑–Ω–∞–π—Ç–µ —ç—Ñ—Ñ–µ–∫—Ç–∏–≤–Ω—É—é –ø—Ä–æ—Ü–µ–Ω—Ç–Ω—É—é —Å—Ç–∞–≤–∫—É.",
        "–ò—Å–ø–æ–ª—å–∑—É–π—Ç–µ –∫—ç—à–±—ç–∫-–∫–∞—Ä—Ç—ã –¥–ª—è –ø–æ–≤—Å–µ–¥–Ω–µ–≤–Ω—ã—Ö –ø–æ–∫—É–ø–æ–∫.",
        "–û–±–Ω–æ–≤–ª—è–π—Ç–µ —Ñ–∏–Ω–∞–Ω—Å–æ–≤—É—é —Ü–µ–ª—å —Ä–∞–∑ –≤ 3‚Äì6 –º–µ—Å—è—Ü–µ–≤.",
        "–ü—Ä–æ–≤–µ—Ä—è–π—Ç–µ –∞–∫—Ç—É–∞–ª—å–Ω–æ—Å—Ç—å –ø–∞—Å–ø–æ—Ä—Ç–∞ –ø–µ—Ä–µ–¥ –≤–∞–ª—é—Ç–Ω–æ–π –æ–ø–µ—Ä–∞—Ü–∏–µ–π.",
        "–•—Ä–∞–Ω–∏—Ç–µ —Ä–µ–∑–µ—Ä–≤–Ω—ã–π —Ñ–æ–Ω–¥ –æ—Ç–¥–µ–ª—å–Ω–æ –æ—Ç –æ—Å–Ω–æ–≤–Ω—ã—Ö —Ä–∞—Å—Ö–æ–¥–æ–≤.",
    ];


    const randomTip = tips[Math.floor(Math.random() * tips.length)];

    return (
        <>
            <div className="finance-tip">
                <h2 className="finance-tip__title">üí° –°–æ–≤–µ—Ç –¥–Ω—è</h2>
                <p className="finance-tip__text">{randomTip}</p>
            </div>

        </>

    )
        ;
};

export default FinanceTip;
